##j petljom prolazimo kroz genom, a k petljom kroz patch
##u k petlji usporedujemo k-poziciju patterna i usporedujemo
##sa k-pozicijom genoma u dijelu j:j+len(pattern) i brojimo
##greske. Kad pregledamo cijeli dio genoma, usporedujemo brojac
##sa ulaznim podatkom i ako je dobar, ispisujemo indeks i resetiramo
##brojac, a ako nije samo resetiramo brojac
def app(pattern, genom, mismatch):
    counter = 0
    for j in range(len(genom) - (len(pattern) - 1)):
        for k in range(len(pattern)):
            if(pattern[k] != genom[j:j+len(pattern)][k]):
                counter += 1
        if(counter <= mismatch):
            print(j, end=' ')
            counter = 0
        else:
            counter = 0
  
    return
app("CGCGATGCTGA", """""", 4)
